import React, { useState } from 'react';
import { Tab, Tabs, TabList, TabPanel } from 'react-tabs';
import '../css/Tab.css';

const GroupTabs = () => {
    return (
        <Tabs>
        <TabList>
          <Tab>Your Groups</Tab>
          <Tab>Search Groups</Tab>
        </TabList>

        <TabPanel>
          <h1>Your groups here</h1>
        </TabPanel>
        <TabPanel>
          <h1>All groups here</h1>
        </TabPanel>
      </Tabs>
    )
}

export default GroupTabs;
